class Solution:
    from typing import List
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        '''
        Brute force
        1032 ms
        '''
        ret = set()
        total = len(nums)
        for i in range(total-2):
            if i-1>=0 and nums[i-1] == nums[i]:
                continue
            target1 = 0 - nums[i]
            mapping = {}
            for j in range(i+1, total):
                target2 = target1 - nums[j]
                if target2 in mapping:
                    coordinate = [nums[i], target2, nums[j]]
                    coordinate.sort()
                    ret.add(tuple(coordinate))
                mapping[nums[j]] = j
        return list(ret)

        

import unittest
class TestStringMethods(unittest.TestCase):
    obj = Solution()
    def test_1(self):
        ret = self.obj.threeSum([-1, 0, 1, 2, -1, -4])
        self.assertEqual(ret, [
            [-1, 0, 1],
            [-1, -1, 2]
        ])
